import React from "react";
import "../index.css";
import Header from "../components/Header";
import TitleSection from "../components/TitleSection";
import CriteriaSection from "../components/CriteriaSection";

function App() {
  return (
    <div>
      <Header />
      <TitleSection />
      <CriteriaSection />
    </div>
  );
}

export default App;
